import ReactDOM from 'react-dom';
import React from 'react';

class Clock extends React.Component{
    constructor(props){
        super(props);
        this.state = {date: new Date()};
    }
    render(){
        return (
            <div>
                <h1>Hello World.</h1>
                <p>It is {this.state.toLocaleTimeString()}.</p>
            </div>
        );
    }
}

ReactDOM.render(
    <Clock />,
    document.getElementById('root')
);
